import React, { Component } from "react";
import { Link } from "react-router-dom";
import { NeyaLogo } from "../images/NeyaLogo.svg"

export const Presentation = () => {

    return (
        <div className="sideElements">
            <div className="sideLogo">
                <img src={NeyaLogo} />
            </div>
        </div>
    );
}
